import{_ as e,o as a,c as t,O as i}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 58.1-1017.2 Sealed pack labeled as cigarettes; prima facie evidence of cigarettes.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-1017.2.md","filePath":"vacode/58.1-1017.2.md"}'),r={name:"vacode/58.1-1017.2.md"},c=i('<h1 id="§-58-1-1017-2-sealed-pack-labeled-as-cigarettes-prima-facie-evidence-of-cigarettes" tabindex="-1">§ 58.1-1017.2 Sealed pack labeled as cigarettes; prima facie evidence of cigarettes. <a class="header-anchor" href="#§-58-1-1017-2-sealed-pack-labeled-as-cigarettes-prima-facie-evidence-of-cigarettes" aria-label="Permalink to &quot;§ 58.1-1017.2 Sealed pack labeled as cigarettes; prima facie evidence of cigarettes.&quot;">​</a></h1><p>In any prosecution for violations of this title, where a sealed pack is labeled as containing cigarettes, such labeling shall be prima facie evidence that the contents of the pack meet the definition of &quot;cigarette&quot; as defined by § <a href="http://law.lis.virginia.gov/vacode/58.1-1000/" target="_blank" rel="noreferrer">58.1-1000</a>. Nothing shall preclude the introduction of other relevant evidence to establish the contents of a pack, whether sealed or not.</p><p>2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0301" target="_blank" rel="noreferrer">301</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0422" target="_blank" rel="noreferrer">422</a>.</p>',3),o=[c];function n(s,l,d,f,p,h){return a(),t("div",null,o)}const v=e(r,[["render",n]]);export{g as __pageData,v as default};
